export function shyftClusterApiUrl(apiKey, cluster) {
    switch (cluster) {
        case 'devnet':
            return `https://devnet-rpc.shyft.to/${apiKey}`;
        case 'mainnet-beta':
            return `https://rpc.shyft.to/${apiKey}`;
        default:
            return '';
    }
}
